//Navbar of our Web Application. contains logo and link for HomeBody.js and About.js visit them
import React,{ useState } from 'react'
import Logo from './images/EQ-Sol Logo Full.svg'
import {Collapse,Navbar,NavbarToggler,NavbarBrand,Nav,NavItem,NavbarText} from 'reactstrap';
import {Link, NavLink} from 'react-router-dom'

export default function NavbarHome() {

    const [isOpen, setIsOpen] = useState(false);  
    const toggle = () => setIsOpen(!isOpen);
   
    // setHome(<Link to="/" className="fas fa-home homenavbar-icon active" ></Link>)
    const [HomeActive,SetActive] = useState(false);
    var Home;
    function LinkActive() {
        // setHome(<Link to="/" className="fas fa-home homenavbar-icon" ></Link>)
        SetActive(true)
        console.log("jii");
    }

    if(HomeActive){
        Home = <Link to="/" className="fas fa-home homenavbar-icon" ></Link>
    }else{
        Home = <Link to="/" className="fas fa-home homenavbar-icon" ></Link>
    }
    return (
        <div>
             <Navbar className="navbar-home" expand="xs">
                <NavbarBrand>
                    <Link to="/">
                        <img src={Logo} className="navbarhome-logo" />
                    </Link>
                </NavbarBrand>
                <NavbarToggler onClick={toggle} />
                <Collapse isOpen={isOpen} navbar>
                    <Nav className="mr-auto ml-auto" navbar>
                        <NavItem>
                            {Home}
                        </NavItem>
                        <NavItem>
                            <NavLink to="/about" onClick={LinkActive()} activeClassName="active" className="fas fa-info-circle homenavbar-icon" ></NavLink>
                        </NavItem> 
                    </Nav>
                    <NavbarText><i class="fas fa-cog" style={{fontSize:"30px"}}></i></NavbarText>
                </Collapse>
            </Navbar>
        </div>
    )
}
